    static parse = (): Array<Character> => {
        if (BaseKClass.vm.characters.isNotEmpty()) return BaseKClass.vm.characters;
        let index = 0;
        const characters = [];
        CharacterData.HTML.split(`<div class='wiki-paragraph'></div>`).forEach((element: string) => {
            if (!element.contains('스프라이트')) return;
            let value = element.split('스프라이트</span></strong>')[1];
            let cutString = value.split('<tr>')[0];
            let substringLength = cutString.length;
            value = value.substring(substringLength);
            value = value.substring(0, value.lastIndexOf('</tbody>'));

            const parseUrl = (line: string) => line.split(`'`)[1].split(`'`)[0];
            const parseName = (line: string) => line.split('<strong>')[1].split('<')[0];
            const sexs = [];
            const names = [];
            const imageUrls = [];

            value.split('\n').forEach((line: string) => {
                if (line.contains('여성')) {
                    sexs.push(CharacterType.WOMEN);
                }
                else {
                    sexs.push(CharacterType.MEN)
                }

                if (line.startsWith(`src='//w`)) {
                    imageUrls.push(`https:${parseUrl(line)}`);
                }
                else if (line.contains(`style='color:#fff'><strong>`)) {
                    names.push(parseName(line));
                }
            });

            for (let i = 0; i < names.length; i++) {
                characters.push(new Character(names[i], sexs[i], CharacterType.loadTypeFromIndex(index), imageUrls[i]));
            }

            index++;
        });
        BaseKClass.vm.characters = characters;
        return BaseKClass.vm.characters;
    }
